import './Main.css';
import Header from './components/header/Header';
import { Routes, Route } from "react-router-dom";
import Blog from './pages/Blog';
import Cenik from './pages/Cenik';
import Kontakt from './pages/Kontakt';
import NaseSluzby from './pages/NaseSluzby';
import Reference from './pages/Reference';
import Realizace from './pages/Realizace';
import Vizualizace from './pages/Vizualizace';
import Home from './pages/Home';
function Main() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Home />}/>
        <Route path='/blog' element={<Blog />} />
        <Route path='/cenik' element={<Cenik />}/>
        <Route path='/kontakt' element={<Kontakt />}/>
        <Route path='/nase-sluzby' element={<NaseSluzby />} />
        <Route path='/reference' element={<Reference />}/>
        <Route path='/realizace' element={<Realizace />}/>
        <Route path='/vizualizace' element={<Vizualizace />}/>
      </Routes>
    </div>
  );
}

export default Main;
